// ==UserScript==
// @name           hello kitty walk
// @namespace      hello kitty walk
// @description    hello kitty walk
// @include        *
// ==/UserScript==

window.addEventListener("load", function(){  

    var lx=window.innerWidth;
    var ly=window.innerHeight;
    var x=Math.floor(Math.random()*lx);
    var dx=2;
    var y=Math.floor(Math.random()*ly);
    var dy=2;
    
    var kittyBase = 'data:image/gif;base64,';
    
    var Img=document.createElement("img");
    Img.setAttribute('src', kittyBase);
    Img.setAttribute('alt', 'kitty');
    Img.setAttribute('style', 'position:absolute;top:'+y+'px;left:'+x+'px;z-index:9999');
    Img.setAttribute('id', 'kitty');
    document.body.appendChild(Img);

    setInterval("move()",50);

    move=function(){if(y+135>ly||y<10)dy*=-1;if(x+132>lx||x<10)dx*=-1;y+=dy;x+=dx;document.getElementById('kitty').style.left=x+"px";
    document.getElementById('kitty').style.top=y+"px";}
    
    }, false);